import React from 'react';
import './Hero.css';

function Hero() {
  return (
    <section id="hero" className="hero">
      <div className="hero-content">
        <h1>Welcome to Creative Creations Clothing Company</h1>
        <p>Your premier apparel manufacturer trusted for quality and innovation.</p>
      </div>
    </section>
  );
}

export default Hero;
